import React from 'react'
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import { useEffect, useState } from "react";
import { toast } from 'react-hot-toast';

export default function Profile() {
  const navigate = useNavigate();
  const [jmeno, setName] = useState('');

  useEffect(() => {
    axios.get('http://localhost:3001/profile', { withCredentials: true })
      .then(res => {
        if (res.data.Status === "Success") {
          setName(res.data.jmeno);
        } else {
          navigate('/Login');
        }
      })
      .catch(error => {
        toast.error("Došlo k chybě při náčítání stránky profilu. " + error);
      });
  })
  return (
    <>
      <div>
        <div className="container">
          <div className="row">
            <div className="col col-xxl-4 col-xl-4 col-lg-4">
              <svg xmlns="http://www.w3.org/2000/svg" width="100" height="100" fill="currentColor" class="bi bi-person-circle" viewBox="0 0 16 16">
                <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
                <path fill-rule="evenodd" d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1" />
              </svg>
            </div>
            <div className="">

            </div>
          </div>
        </div>
      </div>
    </>
  )
}
